import Header from '../../components/header/Header';
import './forms.css';

const register = () => {
    return (
        <div className="wrapper">
            {/* Header Start */}
            <header className='header-container'>
                <Header />
            </header>
            {/* Header End */}

            {/* Main Start */}
            <main className='main-container'>

            </main>
            {/* Main End */}

            {/* Footer Start */}
            <footer className='footer-container'>
                <Footer />
            </footer>
            {/* Footer End */}

        </div>
    )
}

export default register
